> Top News Pressure builds on Paul Ryan to run for House speaker Rep. Paul Ryan, R-Wis. arrives for a House GOP meeting on Capitol Hill in Washington, Friday, Oct. 9, 2015. The pressure is on Ryan to run for House speaker in the chaotic aftermath of Majority Leader Kevin McCarthy's sudden decision to abandon his campaign for the post. (Doug Mills/ The New York Times via AP) 
